(75, 182, 'IceMegaMenu', 'icemegamenu', '', '<p><img src="images/sampledata/icetheme/extensions/icemegamenu.jpg" border="0" alt="IceMegaMenu Module" /></p>\r\n<p><span class="dropcap">W</span>hen the time came and we had to move to the new Joomla 1.6 version, we at IceTheme wanted to give you a special gift, well in fact one of most used modules... a new menu module. But the powerful IceMegaMenu extension is not the next simple menu module that you may find anywhere. No I''m sorry you will not...</p>\r\n<p>Based from our long experience with Joomla and listening as well to your suggestions we are proud to preset one of our most mighty Joomla extension that we have ever built until now. But what makes the IceMegaMenu extension so great?!</p>\r\n<p>First on the extension package you will find the module zip and the plugin zip. The module part has all the necessary features ready at your fingertips to run the menu exactly the way you need to. You will find features like the ability to load different themes (you may have a dark website), dropdown effect like slide, fade or both, ability to load images inside the menu items, dropdown opacity, ability to disable JavaScript and much more.</p>\r\n<p>On the plugin part came the interesting part. After lots of request from our valuable members, now you are able to split the dropdown into as many columns as you wish and exactly the way you need to. Also you may load any Joomla modules inside the dropdown directly by selecting the module name or the module position. Another interesting feature that may be very handy to you is the ability to put for each menu item the width for the dropdown and the width for each column of the dropdown, so as you can see you have total control over the way the module operates.</p>\r\n<h2>Unique Features</h2>\r\n<ul class="star">\r\n<li>Chose your desired style based from your website colors from a list of pre-built module themes</li>\r\n<li>Select the dropdown running effect from slide, fade or both</li>\r\n<li>You may disable the JavaScript if you need just a simple and fast running menu with no conflicts whatsoever.</li>\r\n<li>Ability to load menu images into each menu item</li>\r\n<li>Split exactly the way your require the dropdown by having total control to the full dropdown width, to each column width and the number of menu items to display to each column.</li>\r\n<li>Ability to load any Joomla Module to the dropdown by selecting either from the Module Name of from the Module Position.</li>\r\n</ul>', '', 1, 0, 0, 81, '2011-08-02 12:12:33', 42, '', '2011-08-02 12:16:04', 42, 0, '0000-00-00 00:00:00', '2011-08-02 12:12:33', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 0, '', '', 1, 22, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(76, 183, 'IceShare', 'iceshare', '', '<p><img src="images/sampledata/icetheme/extensions/iceshare.jpg" border="0" alt="IceShare" style="border: 0;" /></p>\r\n<p><span class="dropcap">W</span>ith the IceShare plugin you have the possibility to dramatically increase your social circle by letting your users submit your stories on their preferred social websites like FaceBook, Twitter, Yahoo, Digg etc. The benefits of this plug-in are enormous as the traffic that is generated from the social websites can result not only higher but relevant, as well.</p>\r\n<p>This plugin may float on the left or the right of the page making it easier to submit the news. Also this submission is done dynamically without page-load, giving comfort to your users as they don''t have to leave the current page.</p>\r\n<p>The IceShare Plugin is redistributed under the GPL license, so is free for use but note also that for all our Joomla Extensions we provide support from our Forums</p>\r\n<h2>Unique Features</h2>\r\n<ul class="star">\r\n<li>Ability to position the plug-in (left/right)</li>\r\n<li>Ability to automatically scroll the plug-in or not</li>\r\n<li>Enable/Disable each social website and choose your preferred parameters for them</li>\r\n<li>Select the category articles in which the plug-in should appear</li>\r\n<li>Select the component page in which the plug-in should appear</li>\r\n</ul>', '', 0, 0, 0, 81, '2011-08-02 12:12:57', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-08-02 12:12:57', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 2, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(77, 184, 'IceSpeed', 'icespeed', '', '<p><img src="images/sampledata/icetheme/extensions/icespeed.jpg" border="0" alt="IceCaption" style="border: 0;" /></p>\r\n<p><span class="dropcap">I</span>IceSpeed Plugin decrease the loading time of your website by compressing, optimizing, merging CSS and JavaScript on your website. With this powerful plugin your website will dramatically decrease the loading time as all CSS and JavaScriopt will be compressied and/or merged. Also you may go one step further and enable Gzip compression technology which can reduce even more the loading time. The other great part of the plugin is the ability to control at your hands the page cache and the browser cache with the parameters. Words are useless to describe how powerful this plugin can be on your website</p>\r\n<h2>Unique Features</h2>\r\n<ul class="star">\r\n<li>Optimize and/or Compress and/or Merge CSS and JavaSript files</li>\r\n<li>Optimize HTML</li>\r\n<li>Ability to exclude/include CSS and JavaScript files</li>\r\n<li>Gzip compression technology option ready!</li>\r\n<li>Ability to change the JavaScript files order (prevent conflicts)</li>\r\n<li>Enable/Disable page cache</li>\r\n<li>Enable/Disable browser default cache</li>\r\n<li>Ability to clear on the fly the cache</li>\r\n<li>You may enable/disable cache to single menu items also</li>\r\n</ul>', '', 1, 0, 0, 81, '2011-08-02 12:13:15', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-08-02 12:13:15', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 1, '', '', 1, 22, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(78, 185, 'IceTabs', 'icetabs', '', '<p><img src="images/sampledata/icetheme/extensions/icetabs.jpg" border="0" alt="IceTabs" style="border: 0;" /></p>\r\n<p><span class="dropcap">I</span>ceTabs module marks another immense milestone at IceTheme. We can say without any single doubt that this module is one of the best ever built Joomla Extensions by our club and also on all the Joomla! market as well. But... why?!</p>\r\n<p>First let''s describe what is the scope of the IceTab module.</p>\r\n<p>IceTab module can display any content/banner/images/K2/VirtueMart information with a smooth and nice interface based on the tabular interface. So to describe more clearly, you may display your Joomla content and this is the primary scope of this module but you may easily use it to be a image gallery by switching to the "image" mode. Also you may use to display content from the popular K2 extension an to display products from the VirtueMart extension. The IceTab module is bult-in all parameters needed so that you have the possibility to adjust perfectly in the way you like.</p>\r\n<h2>Unique Features</h2>\r\n<ul class="star">\r\n<li>Display anything by changing mode to content/banner/image/K2/VirtueMart</li>\r\n<li>Suit easily to your website layout by choosing various pre-built themes</li>\r\n<li>Customize the module in the way you like from module parameters</li>\r\n</ul>', '', 1, 0, 0, 81, '2011-08-02 12:13:30', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-08-02 12:13:30', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 0, '', '', 1, 30, '{"robots":""