(74, 181, 'IceCarousel', 'icecarousel', '', '<p><img src="images/sampledata/icetheme/extensions/icecarousel.jpg" border="0" alt="IceCarousel" style="border: 0;" /></p>\r\n<p>IceCarousel is a very powerful Joomla module with a large set of useful parameters to filter and order your Joomla Articles. It uses Ajax technology to change the slides, which can speed up your site in case you need to display many slides. The module is very easy to be set up and within 2 minutes your Joomla website will have a nice and customized as you wish carousel module.</p>\r\n<p>Also the module support <strong>JoomShopping Extension</strong> to display your products. This part has its own paramters as well.</p>\r\n<p>The IceCarousel Module is redistributed under the GPL license, so is free for use but note also that for all our Joomla Extensions we provide support from our Forums</p>\r\n<h2>Unique Features</h2>\r\n<ul class="star">\r\n<li>Many useful paramters to display exactly those articles that your project require.</li>\r\n<li>Automatically cropeed images with the width and height that you set up</li>\r\n<li>Ajax technology to change slides, which can speed up your site if you need to display lots of items.</li>\r\n<li>Fully support the JoomShopping Extensions. It has its own paramter to filter the products you need to display.</li>\r\n</ul>', '', 1, 0, 0, 81, '2011-08-02 12:12:09', 42, '', '2011-08-16 09:49:34', 42, 0, '0000-00-00 00:00:00', '2011-08-02 12:12:09', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 3, '', '', 1, 29, '{"robots":"","author":"","rights":"","xreference"