(73, 180, 'IceAccordion', 'iceaccordion', '', '<p><img src="images/sampledata/icetheme/extensions/iceaccordion.jpg" border="0" alt="IceAccordion" style="border: 0;" /></p>\r\n<p><span class="dropcap">I</span>ceAccordion is a simple yet powerful module based on the popular Mootools library. It can display a set of article in an accordion way. It should be used when the vertical space is limited and you have a large number of articles. As all our modules, IceAccordion is accessible and usable, mean that if in any case Javascript is disabled on the user''s browser the articles are displayed normally without any problem.</p>\r\n<p> </p>\r\n<p>The IceAccordin Module is redistributed under the GPL license, so is free for use but note also that for all our Joomla Extensions we provide support from our Forums</p>\r\n<h2>Unique Features</h2>\r\n<ul class="star">\r\n<li>Ability to load articles pertaining to a category</li>\r\n<li>Ability to load articles from individual articles IDs</li>\r\n<li>Select from 3 available theme options.</li>\r\n<li>Ability to show/hide the readmore button</li>\r\n</ul>', '', 1, 0, 0, 81, '2011-08-02 12:11:39', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-08-02 12:11:39', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 4, '', '', 1, 23, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
