it. Nulla dapibus sapien vel mauris viverra quis euismod dui tincidunt. Phasellus laoreet mattis est, eu vulputate sapien suscipit ac. Vestibulum porttitor justo a est elementum luctus. Nulla ac pharetra nulla. Quisque metus orci, cursus at sollicitudin sit.</p>\r\n<p class="notice">This is a sample of the ''notice'' style. Use this style to give your users a message that require a note</p>\r\n<p class="success">This is a sample of the ''success'' style. Use this style to give your users a message when a successful task was completed</p>\r\n<p class="error">This is a sample of the ''error'' style. Use this style to give your users a message when a task was wrongly completed</p>\r\n<form method="post"><fieldset><legend>Sample Legend</legend>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla dapibus sapien vel mauris viverra quis euismod dui tincidunt. Phasellus laoreet mattis est, eu vulputate sapien suscipit ac. Vestibulum porttitor justo a est elementum luctus. Nulla ac pharetra nulla. Quisque metus orci.</p>\r\n<p><label for="input">Sample Input</label> <input id="name" class="inputbox" type="input" name="name" /></p>\r\n<p><input id="radio" type="radio" /><label for="radio">Sample Radio Input</label></p>\r\n<p><input id="checkbox" type="checkbox" /><label for="checkbox">Sample CheckBox Input:</label></p>\r\n<p><label for="select">Sample Select Field:</label><br /> <select id="select"><option>Option One</option><option>Option Two</option></select></p>\r\n<p><label for="textarea">Sample Textarea Field:</label><br /> <textarea id="textarea" rows="5" cols="30">Textarea text</textarea></p>\r\n<button><span class="round"><span>Submit Button</span></span></button> <button><span class="round"><span>Reset Button</span></span></button></fieldset></form>', '', 1, 0, 0, 79, '2011-08-01 12:18:31', 42, '', '2011-08-19 09:13:45', 42, 0, '0000-00-00 00:00:00', '2011-08-01 12:18:31', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro"