(68, 174, 'Clone Installer', 'clone-installer', '', '<p><span class="dropcap">I</span>ceTheme is here to make your things as easy as possible providing you the tools that you need to make your website working as fast as a simple Joomla Installation. With the "Clone Installer" package you have the possibility to make your website exactly as you see on our demo page (http://demo.icetheme.com).</p>\r\n<p>This great feature will save you lots of time as you will have all the configurations and parameters set by default. Also you will have our sample images updated and every extension enabled and working. So all you have to do is to change the images or the some parameters and you are done.</p>\r\n<p>Anyway be careful as this package will work only if you are starting your website from scratch. If you already have a working Joomla! website you should not make use of this feature as the database sql file may delete your current database.</p>\r\n<p>For more information on how-to set up your website with the Clone Installer package please refer to the Installation Guide in PDF format which is inside the All in One Package. In case you have any questions please <a href="http://icetheme.com/About/Contact.html">Contact Us</a></p>', '', 1, 0, 0, 79, '2011-08-01 12:16:58', 42, '', '2011-08-16 10:01:05', 42, 0, '0000-00-00 00:00:00', '2011-08-01 12:16:58', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 4, '', '', 1, 55, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(69, 175, 'Module Positions', 'module-positions', '', '<p><span class="dropcap">T</span>his Joomla! template supports a wide variety of module positions which can be archived automatically by the system.The module positions are fully collapsible mean that if there are no modules published in particular position, this module position will disappear and the other modules with take this place.</p>\r\n<p>Also you can have 3-Columns layout (content, left and right), 2-Columns layout (content plus left or right) or 1-Column layout (only the content). The width for the left and right columns can be set through the Template Manager in Joomla Administrator.</p>\r\n<p><img src="images/sampledata/icetheme/features/layout.jpg" border="0" alt="Module Positions" /></p>', '', 1, 0, 0, 79, '2011-08-01 12:17:19', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-08-01 12:17:19', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 3, '', '', 1, 43, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(70, 176, 'Module Variations', 'module-variations', '', '<p>This page on our demo template is showing you general all our possible modules with styles included. The modules are fully collapsible mean that if there are no modules published in a particular area, this module position will disappear...</p>\r\n', '\r\n<p><span class="dropcap">T</span>his page on our demo template is showing you all our possible modules with their respective styles included. The modules are fully collapsible which mean that if there are no modules published in a particular area, this module position will disappear.</p>\r\n<p>The module class suffixes that you can use are:</p>\r\n<ul>\r\n<li><strong>-style1</strong> (available to left,right,promo1,promo2 andpromo3 modules positions)</li>\r\n<li><strong>-style2</strong> (available to left,right,promo1,promo2 and promo3 modules positions)</li>\r\n</ul>\r\n<p>If you want to use a module class suffix, please follow this instructions. First login into the Joomla administrator and go to Extensions, then to Module Manager page. Select your desired module and find the "Module Class Suffix" input box. Add your module class suffix in this box and save. Note that you should NOT add the (point) before the module suffix as it is the CSS class.</p>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. In sed neque lacus, at fermentum turpis. Maecenas id lectus in augue consequat viverra id eu tortor. Sed suscipit, velit id venenatis sagittis, nunc magna suscipit nibh, ut laoreet velit dui sit amet turpis. Praesent molestie lobortis fermentum. Curabitur eget nisi quis lorem dapibus placerat sit amet et sapien. Curabitur in interdum ligula. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Pellentesque habitant morbi tristique senectus et netus.</p>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. In sed neque lacus, at fermentum turpis. Maecenas id lectus in augue consequat viverra id eu tortor. Sed suscipit, velit id venenatis sagittis, nunc magna suscipit nibh, ut laoreet velit dui sit amet turpis. Praesent molestie lobortis fermentum.</p>', 1, 0, 0, 79, '2011-08-01 12:17:40', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-08-01 12:17:40', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 2, '', '', 1, 252, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(71, 177, 'Template Styles', 'template-styles', '', '<p>This Joomla template is built-in with an amazing set of 6 different stylish color variations. You can easily change the template style on the Template Manager in J! Administrator. Also your users can have a option to change the style on the fly through our template style-changer.</p>\r\n<p class="notice">Click on the corresponding image to load the Style</p>\r\n<ul class="ice-template-style">\r\n<li><span>Style1</span> <a href="index.php/features/template-styles?&amp;TemplateStyle=style1"> <img src="images/sampledata/icetheme/features/styles/style_1.jpg" border="0" alt="Template Style 1" width="245" height="150" /></a></li>\r\n<li><span>Style2</span> <a href="index.php/features/template-styles?&amp;TemplateStyle=style2"> <img src="images/sampledata/icetheme/features/styles/style_2.jpg" border="0" alt="Template Style 2" width="245" height="150" /></a></li>\r\n<li><span>Style3</span> <a href="index.php/features/template-styles?&amp;TemplateStyle=style3"> <img src="images/sampledata/icetheme/features/styles/style_3.jpg" border="0" alt="Template Style 3" width="245" height="150" /></a></li>\r\n<li><span>Style4</span> <a href="index.php/features/template-styles?&amp;TemplateStyle=style4"> <img src="images/sampledata/icetheme/features/styles/style_4.jpg" border="0" alt="Template Style 4" width="245" height="150" /></a></li>\r\n<li><span>Style5</span> <a href="index.php/features/template-styles?&amp;TemplateStyle=style5"> <img src="images/sampledata/icetheme/features/styles/style_5.jpg" border="0" alt="Template Style 5" width="245" height="150" /></a></li>\r\n<li><span>Style6</span> <a href="index.php/features/template-styles?&amp;TemplateStyle=style6"> <img src="images/sampledata/icetheme/features/styles/style_6.jpg" border="0" alt="Template Style 6" width="245" height="150" /></a></li>\r\n</ul>', '', 1, 0, 0, 79, '2011-08-01 12:18:09', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-08-01 12:18:09'