(10064, 'TinyMCE nl-NL', 'file', 'TinyMCE_nl-NL', '', 0, 1, 0, 0, '{"legacy":false,"name":"TinyMCE nl-NL","type":"file","creationDate":"18 June 2012","author":"Dutch Translation Team","copyright":"(C) 2010-2012 Dutch Translation Team","authorEmail":"taal@joomlacommunity.eu","authorUrl":"http:\\/\\/www.joomlacommunity.eu","version":"3.5.1.1","description":"\\n\\t\\t<h2>Nederlands taalpakket voor TinyMCE 3.5.1.1 in Joomla 2.5 installeren geslaagd<\\/h2>\\n\\t\\tIndien u andere talen gebruikt dan Nederlands en Engels zorg dan dat u deze taalpakketten ook ge\\u00efnstalleerd heeft, voordat u \\"Automatische taalselectie\\" activeert via de volgende stappen:<br\\/>\\n\\t\\t<ol>\\n\\t\\t<li>Extensies<\\/li>\\n\\t\\t<li>Pluginbeheer<\\/li>\\n\\t\\t<li><a href=\\"index.php?option=com_plugins&view=plugins&filter_search=Tekstverwerker - TinyMCE\\">Tekstverwerker - TinyMCE<\\/a><br\\/>Of zoek in Extensies-Pluginbeheer de Editor - TinyMCE<\\/li>\\n\\t\\t<li>Basis opties<\\/li>\\n\\t\\t<li>Automatische taalselectie instellen op Ja<\\/li>\\n\\t\\t<li>Functionaliteit instellen op Uitgebreid (Optioneel -- Indien u alle functionaliteit wilt gebruiken van)<\\/li>\\n\\t\\t<\\/ol>\\n\\t\\t<p><\\/p>\\n\\t\\t<p>Bugs, taalfouten of verbeteringen kunnen gemeld worden op <a href=\\"http:\\/\\/joomlacode.org\\/gf\\/project\\/nederlands\\/tracker\\/?action=TrackerItemBrowse&tracker_id=10287\\" target=\\"_blank\\">de tracker van het Dutch Translation Team<\\/a><br\\/>\\n\\t\\tOf op het <a href=\\"http:\\/\\/forum.joomlacommunity.eu\\/forumdisplay.php?f=121\\" target=\\"_blank\\">forum van JoomlaCommunity<\\/a><\\/p>\\n\\t\\t<p><\\/p>\\n\\t\\t\\n\\t","group":""}', '', '', '', 0, '0000-00-00 00:00:00', 0, 0),
