(129, 'Template Styles', '', '<p>This Joomla template is built-in with an amazing set of 6 different stylish color variations. You can easily change the template style on the Template Manager in J! Administrator. Also your users can have a option to change the style on the fly through our template style-changer.</p>\r\n<ul class="ice-template-style">\r\n<li><span>Style1</span> <a href="index.php?&amp;TemplateStyle=style1"> <img src="images/sampledata/icetheme/features/styles/style_1.jpg" border="0" alt="Template Style 1" width="158" height="100" /></a></li>\r\n<li><span>Style2</span> <a href="index.php?&amp;TemplateStyle=style2"> <img src="images/sampledata/icetheme/features/styles/style_2.jpg" border="0" alt="Template Style 2" width="158" height="100" /></a></li>\r\n<li><span>Style3</span> <a href="index.php?&amp;TemplateStyle=style3"> <img src="images/sampledata/icetheme/features/styles/style_3.jpg" border="0" alt="Template Style 3" width="158" height="100" /></a></li>\r\n<li class="ice-style4"><span>Style4</span> <a href="index.php?&amp;TemplateStyle=style4"> <img src="images/sampledata/icetheme/features/styles/style_4.jpg" border="0" alt="Template Style 4" width="158" height="100" /></a></li>\r\n<li class="ice-style5"><span>Style5</span> <a href="index.php?&amp;TemplateStyle=style5"> <img src="images/sampledata/icetheme/features/styles/style_5.jpg" border="0" alt="Template Style 5" width="158" height="100" /></a></li>\r\n<li><span>Style6</span> <a href="index.php?&amp;TemplateStyle=style6"> <img src="images/sampledata/icetheme/features/styles/style_6.jpg" border="0" alt="Template Style 6" width="158" height="100" /></a></li>\r\n</ul>', 0, 'no-position', 42, '2013-11-12 04:01:21', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(130, 'Designed With Love By IceTheme!', '', '<p><img src="images/sampledata/icetheme/designed_with_love.png" border="0" alt="Designed with Love" width="65" height="65" /> When you get an IceTheme Premium Joomla Template, you will save yourself many hours of hard work because we have thought for every feature that your next project might need. Take your time to carefully browse this template and you will be amazed how every single detail is in its place.</p>', 1, 'no-position', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
